script: |
  super -f text -I q12234.spq | sort > q12234.out

inputs:
  - name: q12234.spq
    data: |
      SELECT DISTINCT - - col0 * - col1 * - 69 - - + col2 / - col1 AS col2 FROM tab1 (FORMAT parquet) WHERE ( - - ( 78 ) ) * - 32 * + col1 IS NULL AND NOT ( - col0 IS NOT NULL );
  - name: tab1

outputs:
  - name: q12234.out
    data: |
